  "text" : "使用条件（ライセンス）を明記しているのにあらゆるところでそれを守らず無視されていても「個人レベルなら何も言わないでおこう」となっている #jawp と、無断転載を嫌う絵描きさんでは、そもそも「再利用」を認識しているいないという時点で考えに大きな溝がありそうではある。",
